irnd = function (min,max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min + 1)) + min;
}

anim2={

	c1: 1.70158,
	c2: 1.70158 * 1.525,
	c3: 1.70158 + 1,
	c4: (2 * Math.PI) / 3,
	c5: (2 * Math.PI) / 4.5,
	empty_spr : {x:0,visible:false,ready:true, alpha:0},

	slot: [null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null],

	any_on() {

		for (let s of this.slot)
			if (s !== null&&s.block)
				return true
		return false;
	},

	wait(seconds){
		return this.add(this.empty_spr,{x:[0,1]}, false, seconds,'linear');
	},

	linear(x) {
		return x
	},

	kill_anim(obj) {

		for (var i=0;i<this.slot.length;i++)
			if (this.slot[i]!==null)
				if (this.slot[i].obj===obj)
					this.slot[i]=null;
	},

	flick(x){

		return Math.abs(Math.sin(x*6.5*3.141593));

	},


	easeOutBack(x) {
		return 1 + this.c3 * Math.pow(x - 1, 3) + this.c1 * Math.pow(x - 1, 2);
	},

	easeOutElastic(x) {
		return x === 0
			? 0
			: x === 1
			? 1
			: Math.pow(2, -10 * x) * Math.sin((x * 10 - 0.75) * this.c4) + 1;
	},

	easeOutSine(x) {
		return Math.sin( x * Math.PI * 0.5);
	},

	easeOutCubic(x) {
		return 1 - Math.pow(1 - x, 3);
	},

	easeInBack(x) {
		return this.c3 * x * x * x - this.c1 * x * x;
	},

	easeInQuad(x) {
		return x * x;
	},

	easeOutBounce(x) {
		const n1 = 7.5625;
		const d1 = 2.75;

		if (x < 1 / d1) {
			return n1 * x * x;
		} else if (x < 2 / d1) {
			return n1 * (x -= 1.5 / d1) * x + 0.75;
		} else if (x < 2.5 / d1) {
			return n1 * (x -= 2.25 / d1) * x + 0.9375;
		} else {
			return n1 * (x -= 2.625 / d1) * x + 0.984375;
		}
	},

	easeInCubic(x) {
		return x * x * x;
	},

	ease2back(x) {
		return Math.sin(x*Math.PI);
	},

	easeInOutCubic(x) {

		return x < 0.5 ? 4 * x * x * x : 1 - Math.pow(-2 * x + 2, 3) / 2;
	},

	easeInOutBack(x) {

		return x < 0.5
		  ? (Math.pow(2 * x, 2) * ((this.c2 + 1) * 2 * x - this.c2)) / 2
		  : (Math.pow(2 * x - 2, 2) * ((this.c2 + 1) * (x * 2 - 2) + this.c2) + 2) / 2;
	},

	shake(x) {

		return Math.sin(x*2 * Math.PI);


	},

	add (obj,params,vis_on_end,time,func,block) {

		//если уже идет анимация данного спрайта то отменяем ее
		anim2.kill_anim(obj);
		/*if (anim3_origin === undefined)
			anim3.kill_anim(obj);*/

		let f=0;
		//ищем свободный слот для анимации
		for (var i = 0; i < this.slot.length; i++) {

			if (this.slot[i] === null) {

				obj.visible = true;
				obj.ready = false;

				//добавляем дельту к параметрам и устанавливаем начальное положение
				for (let key in params) {
					params[key][2]=params[key][1]-params[key][0];
					obj[key]=params[key][0];
				}

				//для возвратных функцие конечное значение равно начальному
				if (func === 'ease2back'||func==='shake')
					for (let key in params)
						params[key][1]=params[key][0];

				this.slot[i] = {
					obj: obj,
					block:block===undefined,
					params: params,
					vis_on_end: vis_on_end,
					func: this[func].bind(anim2),
					speed: 0.01818 / time,
					progress: 0
				};
				f = 1;
				break;
			}
		}

		if (f===0) {
			console.log("Кончились слоты анимации");


			//сразу записываем конечные параметры анимации
			for (let key in params)
				obj[key]=params[key][1];
			obj.visible=vis_on_end;
			obj.alpha = 1;
			obj.ready=true;


			return new Promise(function(resolve, reject){
			  resolve();
			});
		}
		else {
			return new Promise(function(resolve, reject){
			  anim2.slot[i].p_resolve = resolve;
			});

		}

	},

	process () {

		for (var i = 0; i < this.slot.length; i++)
		{
			if (this.slot[i] !== null) {

				let s=this.slot[i];

				s.progress+=s.speed;

				for (let key in s.params)
					s.obj[key]=s.params[key][0]+s.params[key][2]*s.func(s.progress);

				//если анимация завершилась то удаляем слот
				if (s.progress>=0.999) {
					for (let key in s.params)
						s.obj[key]=s.params[key][1];

					s.obj.visible=s.vis_on_end;
					if (s.vis_on_end === false)
						s.obj.alpha = 1;

					s.obj.ready=true;
					s.p_resolve('finished');
					this.slot[i] = null;
				}
			}
		}

	}

}

