fin_level_panel={

	ok_resolver:0,
	pics_loader:new PIXI.Loader(),
	net_size:4,

	async activate(world,level){

		objects.info_board_cont.x=M_WIDTH;
		objects.info_board_button.visible=false;
		const world_levels_num=worlds_data[world].length;

		if (world>=0){
			objects.world_info.text=`Мир №${world+1}`;
			objects.level_info.text=`Уровень ${level+1}/${world_levels_num}`;
		}

		//порядок открытия тайлов картинок
		const tiles_order={
			4:[0,1,2,3,7,11,15,14,13,12,8,4,5,6,10,9],
			5:[0,1,2,3,4,9,14,19,24,23,22,21,20,15,10,5,6,7,8,13,18,17,16,11,12],
			6:[0,1,2,3,4,5,11,17,23,29,35,34,33,32,31,30,24,18,12,6,7,8,9,10,16,22,28,27,26,25,19,13,14,15,21,20]
		}[this.net_size];

		//показываем уже открытые тайлы
		for (let t=0;t<level;t++){
			const tile=objects.pic_tiles[tiles_order[t]];
			tile.alpha=0.75;
			tile.visible=true;
		}


		await anim2.add(objects.info_board_cont,{x:[M_WIDTH,0]}, true, 0.5,'linear');

		sound.play('tile_open')

		//открываем новый тайл
		const pic_tile=objects.pic_tiles[tiles_order[level]];
		await anim2.add(pic_tile,{alpha:[0,0.75]},true,1,'linear');

		if (level===world_levels_num-1) {

			const anim_obj1=objects.anim_objects.find(o=>o.visible===false);
			anim_obj1.texture=gres.stars_net_img.texture;
			anim_obj1.x=objects.bonus_pic_bcg.x+objects.bonus_pic_bcg.width*0.5;
			anim_obj1.y=objects.bonus_pic_bcg.y+objects.bonus_pic_bcg.height*0.5;
			anim2.add(anim_obj1,{scale_xy:[0.8,1.5],alpha:[0.5,0],angle:[0,10]},false,3,'linear');


			const anim_obj2=objects.anim_objects.find(o=>o.visible===false);
			anim_obj2.texture=gres.bubbles_net_img.texture;
			anim_obj2.x=objects.bonus_pic_bcg.x+objects.bonus_pic_bcg.width*0.5;
			anim_obj2.y=objects.bonus_pic_bcg.y+objects.bonus_pic_bcg.height*0.5;
			anim2.add(anim_obj2,{scale_xy:[0.8,1],alpha:[0.5,0],angle:[0,-50]},false,3,'linear');

			sound.play('world_complete');

			objects.pic_tiles.forEach(t=>t.alpha=1);
			await anim2.add(objects.net,{alpha:[1,0]},true,3,'linear');

		}

		anim2.add(objects.info_board_button,{alpha:[0,1]},true,0.3,'linear');

	},

	async prepare_tiles(world){


		const world_bonus_pic='world'+world;

		//если не загружена то загружаем
		if (!this.pics_loader.resources[world_bonus_pic]){
			this.pics_loader.add(world_bonus_pic,git_src+`res/pics/${world_bonus_pic}.jpg`);
			await new Promise(res=>this.pics_loader.load(res));
		}

		//определяем размер сетки
		this.net_size=Math.sqrt(worlds_data[world].length);

		//устанавливаем сетку
		objects.net.visible=true;
		objects.net.alpha=1;
		objects.net.texture=gres[`net${this.net_size}_img`].texture;

		//сначала скрываем все тайлы
		objects.pic_tiles.forEach(t=>t.visible=false);

		//фиксируем текстуру картинки в этой переменной
		const bonus_texture=this.pics_loader.resources[world_bonus_pic].texture;

		//определяем размеры
		const tex_tile_size_x=bonus_texture.orig.width/this.net_size;
		const tex_tile_size_y=bonus_texture.orig.height/this.net_size;

		const tile_size_x=(objects.bonus_pic_bcg.width-20)/this.net_size;
		const tile_size_y=(objects.bonus_pic_bcg.height-20)/this.net_size;

		//располагаем тайлы и применяем части текстур
		let i=0;
		for(let y=0;y<this.net_size;y++){
			for(let x=0;x<this.net_size;x++){
				const tx=x*tex_tile_size_x;
				const ty=y*tex_tile_size_y;

				const rect = new PIXI.Rectangle(tx, ty, tex_tile_size_x, tex_tile_size_y);
				const quadTexture = new PIXI.Texture(bonus_texture.baseTexture, rect);

				const pic_tile=objects.pic_tiles[i];
				pic_tile.texture=quadTexture;
				pic_tile.visible=false;
				pic_tile.x=objects.bonus_pic_bcg.x+10+x*tile_size_x;
				pic_tile.y=objects.bonus_pic_bcg.y+10+y*tile_size_y;
				pic_tile.width=tile_size_x;
				pic_tile.height=tile_size_y;
				i++;
			}
		}

	},

	all_tiles_opened(){

		let i=0;
		for(let y=0;y<this.net_size;y++){
			for(let x=0;x<this.net_size;x++){
				if (!objects.pic_tiles[i].visible)
					return false;
				i++;
			}
		}
		return true;
	},

	next_button_down(){

		if (anim2.any_on()||anim3.any_on()) return;

		sound.play('click');
		anim2.add(objects.info_board_cont,{x:[0,-M_WIDTH]}, false, 0.5,'linear');
		this.ok_resolver(1);
	},

}

players_cache={

	players:{},

	async my_texture_from(pic_url){

		//если это мультиаватар
		if(pic_url.includes('mavatar')) pic_url=multiavatar(pic_url);

		try{
			const texture = await PIXI.Texture.fromURL(pic_url);
			return texture;
		}catch(er){
			return PIXI.Texture.WHITE;
		}

	},

	async update(uid,params={}){

		//если игрока нет в кэше то создаем его
		if (!this.players[uid]) this.players[uid]={}

		//ссылка на игрока
		const player=this.players[uid]

		//заполняем параметры которые дали
		for (let param in params) player[param]=params[param]

		if (!player.name) player.name=await fbs_once('players/'+uid+'/name')


	},

	async update_avatar(uid){

		const player=this.players[uid];
		if(!player) alert('Не загружены базовые параметры '+uid);

		//если текстура уже есть
		if (player.texture) return;

		//если нет URL
		if (!player.pic_url) player.pic_url=await fbs_once('players/'+uid+'/pic_url');

		if(player.pic_url==='https://vk.com/images/camera_100.png')
			player.pic_url='https://akukamil.github.io/domino/vk_icon.png';

		//загружаем и записываем текстуру
		if (player.pic_url) player.texture=await this.my_texture_from(player.pic_url);

	},

	async update_avatar_forced(uid, pic_url){

		const player=this.players[uid];
		if(!player) alert('Не загружены базовые параметры '+uid);

		if(pic_url==='https://vk.com/images/camera_100.png')
			pic_url='https://akukamil.github.io/domino/vk_icon.png';

		//сохраняем
		player.pic_url=pic_url;

		//загружаем и записываем текстуру
		if (player.pic_url) player.texture=await this.my_texture_from(player.pic_url);

	},

}

hints={

	source:null,
	add_amount:0,
	perc:0,

	activate(s){

		this.source=s;
		objects.t_hints_num.text=this.source.hints_num;
		objects.hint_button_cont.visible=true;

		//обнуляем прогресс
		this.perc=0;
		objects.hint_bcg_mask.height=60;
	},

	down(){

		if (anim2.any_on()||anim3.any_on()) return;

		if (this.source.hints_num<1){
			anim2.add(objects.hint_button_cont,{x:[objects.hint_button_cont.x,objects.hint_button_cont.x+5]}, true, 0.15,'shake');
			return;
		}

		const not_opened_letters=objects.letters_objects.filter(l=>l.visible&&l.opened===0);
		if (not_opened_letters===0) return


		this.source.hints_num--;
		objects.t_hints_num.text=this.source.hints_num;
		if (this.source===game)
			fbs.ref('players/'+my_data.uid+'/hints_num').set(this.source.hints_num);

		const random_letter=not_opened_letters[irnd(0,not_opened_letters.length-1)];


		//определяем глобальное положение целевой буквы
		const tar_x=random_letter.x*objects.crossword_cont.scale_x+objects.crossword_cont.x;
		const tar_y=random_letter.y*objects.crossword_cont.scale_y+objects.crossword_cont.y;

		//анимация
		const free_spr=objects.anim_objects.find(o=>!o.visible);
		if (free_spr){
			free_spr.texture=gres.star_img.texture;
			const sx=objects.hint_button_cont.x+50;
			const sy=objects.hint_button_cont.y+50;
			anim3.add(free_spr,{x:[sx,tar_x,'linear'],y:[sy,tar_y,'linear'],angle:[0,100,'ease2back'],scale_xy:[0.7,1.5,'ease2back'],alpha:[1,0.5,'linear']}, false, 0.7).then(()=>{
				random_letter.open_as_hint();
			})
		}else{
			random_letter.open_as_hint();
		}




	},

	add(amount){

		this.add_amount=amount;
		some_process.process_adding=function(){hints.process_adding()};

	},

	process_adding(){

		this.add_amount--;
		this.perc++;
		objects.hint_bcg_mask.height=60-this.perc*0.6;


		if (this.perc===100){

			//анимация
			const free_spr=objects.anim_objects.find(o=>!o.visible);
			if (free_spr){
				free_spr.texture=gres.white_orb_img.texture;
				free_spr.x=objects.hint_button_cont.x+50;
				free_spr.y=objects.hint_button_cont.y+50;
				anim2.add(free_spr,{alpha:[1,0],angle:[0,200],scale_xy:[0.5,1.2]}, false, 1.5,'linear');
			}

			this.perc=0;
			this.source.hints_num++;

			objects.t_hints_num.text=this.source.hints_num;
			anim2.add(objects.t_hints_num,{scale_xy:[1,1.5]}, true, 1.5,'ease2back');

			if (this.source===game){
				fbs.ref('players/'+my_data.uid+'/hints_num').set(this.source.hints_num);
			}

			objects.t_hints_num.text=this.source.hints_num;
			objects.hint_bcg_mask.height=60;
		}


		if (this.add_amount===0){
			some_process.process_adding=function(){};
		}

	}


}

