	async run_world(s_world, s_level){

		//если это первый раз в игре
		if (my_data.first_log){
			objects.tutorial_info.text='Соединяй буквы и составляй слова отгадывая кроссворд';
			await anim2.add(objects.tutorial_cont,{x:[M_WIDTH,0]}, true, 0.5,'linear');
			tutorial.activate();
			//ждем нажатия кнопки
			await new Promise(res=>{this.action_resolver=res})
			anim2.add(objects.tutorial_cont,{x:[0,-M_WIDTH]}, false, 0.5,'linear');
		}

		for (let world=s_world;world<worlds_data.length;world++){

			//параметры данного мира
			const world_data=worlds_data[world];
			const world_levels_num=world_data.length;
			const start_level=world===s_world?s_level:0;

			for (let level=start_level;level<world_levels_num;level++){

				//объявление о новом мире
				if(level===0){

					//показываем объявление о мире
					objects.t_world_info.text=`Вы начинаете игру в мире №${world+1}`;
					await anim2.add(objects.world_info_cont,{x:[M_WIDTH,0]}, true, 0.5,'linear');

					//ждем нажатия кнопки
					await new Promise(res=>{this.action_resolver=res})

					//убираем объявление
					anim2.add(objects.world_info_cont,{x:[0,-M_WIDTH]}, false, 0.5,'linear');

					//
					//objects.t_coins.text=this.earned_coins_num;

					//вытаксиваем уровень----------------------------------------------------
					objects.game_cont.visible=false;

				}

				//располагаем слова следующего уровня
				this.prepare_words2(world_data[level]);


				//показываем заголовок игры
				objects.t_level.text=`Мир №${world+1}   ${level+1}/${world_levels_num}`;
				objects.t_stars.text=my_data.level_index;
				anim2.add(objects.header_cont,{y:[-100,objects.header_cont.sy]}, true, 0.5,'linear');

				//двигаем и показываем игровое поле
				await anim2.add(objects.game_cont,{x:[M_WIDTH,0]}, true, 0.5,'linear');

				//загружаем картинку и готовим тайлы
				fin_level_panel.prepare_tiles(world);

				//показываем буквы - вычисляем уникальные
				const total_letters={};
				for (let word_data of world_data[level]){
					const word=word_data[0];
					const letters_num={};
					for (letter of word){
						if (letters_num[letter])
							letters_num[letter]++;
						else
							letters_num[letter]=1;
					}

					for (let letter in letters_num){

						if (total_letters[letter])
							total_letters[letter]=Math.max(total_letters[letter],letters_num[letter]);
						else
							total_letters[letter]=letters_num[letter];
					}
				}

				const unique_letters=[];
				Object.entries(total_letters).forEach(([key, value]) => {
				  for (let i = 0; i < value; i++)
					unique_letters.push(key);
				});
				this.letters_num=unique_letters.length;
				this.show_letters(unique_letters);
				this.out_words=[];
				this.word_creation_started=0;
				this.combo=-1;
				this.game_active=1;

				//ждем завершения уровня и анимации
				const res=await new Promise(res=>{game.action_resolver=res})
				if (res==='exit') return;

				this.game_active=0;



				//устанавливаем следующий уровень
				my_data.level_index++;
				fbs.ref('players/'+my_data.uid+'/level_index').set(my_data.level_index);

				//убираем буквы
				await this.drop_letters();
				await this.add_star();


				//двигаем игровой контейнер и показываем объявление
				anim2.add(objects.game_cont,{x:[0,-M_WIDTH]}, false, 0.5,'linear');
				await fin_level_panel.activate(world,level);


				//ждем нажатия кнопки
				await new Promise(res=>{fin_level_panel.ok_resolver=res})

				ad.show();

			}
		}

		//конец игры
		this.process_game_end();


	},

