		const combo_texture=gres.seldom_word.texture;
		objects.combo_caption.texture=combo_texture;

		await anim3.add(objects.combo_caption,{alpha:[0,1,'linear'],scale_xy:[0,0.666,'easeOutBack']}, true, 0.25);
